import React, { Component } from 'react'
import { Text, StyleSheet, View, Image } from 'react-native'

export default function AnswerPage({route}) {
  console.log(route)
    return (
      <View style={styles.container}>
      <Image source={{uri: route.params.questImg}} style={{ width: 200, height: 200 }}></Image>
      <Text>{route.params.questionNumber} {route.params.questTranscript}</Text>
      </View>
    )
  }


const styles = StyleSheet.create({
    container: {
        borderWidth: 3,
        borderColor: 'blue',
        borderRadius: 10,
        padding: 10,
        marginHorizontal:20,
        marginVertical:20,
        justifyContent: 'center',
        alignItems: 'center'
      },
})
